import React from 'react';
import { motion } from 'framer-motion';
import SEO from '../components/SEO';
import { faq } from '../data/faqData';
import { Link } from 'react-router-dom';

import { FaPhone, FaEnvelope } from 'react-icons/fa';

const Faq = () => {
  const containerVariants = { hidden: { opacity: 0 }, visible: { opacity: 1 } };

  return (
    <div className="py-24 bg-gradient-to-br from-gray-50 to-white min-h-screen">
      <SEO title="FAQ" description="Frequently asked questions about our mobile foot care services" />

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-20"
        >
          <motion.span
            initial={{ opacity: 0, scale: 0 }}
            whileInView={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.5 }}
            viewport={{ once: true }}
            className="inline-block px-4 py-2 bg-blue-100 text-blue-800 rounded-full text-sm font-semibold mb-6 tracking-wide"
          >
            FREQUENTLY ASKED QUESTIONS
          </motion.span>
          <h2 className="text-4xl md:text-5xl font-bold text-gray-900 mb-6 tracking-tight">
            Common Questions About
            <span className="block text-primary">Our Foot Care Services</span>
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto leading-relaxed">
            Find answers to common questions about our mobile foot care services, booking process, and safety protocols.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
          {faq.map((category, idx) => (
            <motion.div
              key={category.id}
              initial={{ opacity: 0, y: 40 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.1 * idx }}
              viewport={{ once: true }}
              className="bg-white rounded-3xl p-8 shadow-lg hover:shadow-xl transition-shadow duration-300"
            >
              <div className="flex items-center mb-6">
                <div className="w-12 h-12 bg-gradient-to-br from-primary to-secondary rounded-xl flex items-center justify-center text-white mr-4">
                  <category.icon className="w-6 h-6" />
                </div>
                <h3 className="text-xl font-bold text-gray-900">{category.title}</h3>
              </div>

              <div className="space-y-4">
                {category.items.map((qa, i) => (
                  <div key={i}>
                    <h4 className="font-semibold text-gray-900 mb-2">{qa.q}</h4>
                    <p className="text-gray-600">{qa.a}</p>
                  </div>
                ))}
              </div>
            </motion.div>
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5, duration: 0.6 }}
          viewport={{ once: true }}
          className="text-center mt-16"
        >
          <div className="bg-gradient-to-r from-primary/10 to-secondary/10 rounded-3xl p-8">
            <h3 className="text-2xl font-bold text-gray-900 mb-4">Still Have Questions?</h3>
            <p className="text-gray-600 mb-6 max-w-2xl mx-auto">
              We're here to help! Contact us directly for any additional questions about our services, scheduling, or specific foot care needs.
            </p>
            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <a href="tel:403-903-4293" className="inline-flex items-center justify-center px-6 py-3 bg-primary text-white rounded-xl font-semibold hover:bg-primary/90 transition-colors">
                <FaPhone className="w-4 h-4 mr-2" />
                Call (403) 903-4293
              </a>
              <Link to="/contact" className="inline-flex items-center justify-center px-6 py-3 bg-white text-primary border-2 border-primary rounded-xl font-semibold hover:bg-primary hover:text-white transition-colors">
                <FaEnvelope className="w-4 h-4 mr-2" />
                Send Message
              </Link>
            </div>
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default Faq;
